import React from 'react'

function PageNotFound() {
  return (
    <div className='container text-center p-5 vh-100 '>
      <h1 className='mb-3'>Error 404</h1>
      <h1>Page Not Found</h1>
    </div>
  )
}

export default PageNotFound
